const ProfileForm = () => {
    const [currentPage, setCurrentPage] = useState(1);
    const imagesPerPage = 20; // 5x4 grid
    const totalImages = profileImages.length;
    const totalPages = Math.ceil(totalImages / imagesPerPage) || 1;

    // Lấy hình ảnh cho trang hiện tại
    const startIndex = (currentPage - 1) * imagesPerPage;
    const currentImages = profileImages.slice(startIndex, startIndex + imagesPerPage);

    const handlePageChange = (page: number) => {
        setCurrentPage(page);
    };

    return (
        <div className="max-w-7xl mx-auto space-y-8">
            {/* Phần trên (header, tabs Posts/Followers/Following) đã có, bỏ qua */}
            <ProfileImages
                images={currentImages}
                currentPage={currentPage}
                totalPages={totalPages}
                onPageChange={handlePageChange}
            />
        </div>
    );
};

export default ProfileForm;